import React from "react";

const MealItem = (props) => {
  return (
    <li>
      <div>
        <h3>{props.name}</h3>
        <div>{props.description}</div>
        <div>${props.amount}</div>
      </div>
      <div>
        <label>Amount:</label>
        <input type="number" min="0"></input>
        <button> + Add </button>
      </div>
    </li>
  );
};
export default MealItem;
